0441\u0442\u0432\u043e\u0438\u0441\u043f\u044b\u0442\u0430\u0442\u0435\u043b\u044c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%BA%D0%BB%D0%B5%D1%80_%D0%B4%D0%B5_%D0%91%D1%8E%D1%84%D1%84%D0%BE%D0%BD,_%D0%96%D0%BE%D1%80%D0%B6-%D0%9B%D1%83%D0%B8\" class=\"mw-redirect\" title=\"\u041b\u0435\u043a\u043b\u0435\u0440 \u0434\u0435 \u0411\u044e\u0444\u0444\u043e\u043d, \u0416\u043e\u0440\u0436-\u041b\u0443\u0438\">\u0416\u043e\u0440\u0436 \u0434\u0435 \u0411\u044e\u0444\u0444\u043e\u043d<\/a> \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u043b \u0410\u043a\u0430\u0434\u0435\u043c\u0438\u0438 \u043c\u043e\u043d\u0443\u043c\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u044b\u0439 \u0442\u0440\u0443\u0434 \u00ab\u0415\u0441\u0442\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0438\u0441\u0442\u043e\u0440\u0438\u044f\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1758_%D0%B3%D0%BE%D0%B4\" title=\"1758 \u0433\u043e\u0434\">1758<\/a>&#160;\u2014 \u0423 \u0434\u0435\u0440\u0435\u0432\u043d\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%BE%D1%80%D0%BD%D0%B4%D0%BE%D1%80%D1%84%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u0426\u043e\u0440\u043d\u0434\u043e\u0440\u0444\u0441\u043a\u043e\u0435 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435\">\u0426\u043e\u0440\u043d\u0434\u043e\u0440\u0444<\/a> 25-\u0442\u044b\u0441\u044f\u0447\u043d\u0430\u044f \u043f\u0440\u0443\u0441\u0441\u043a\u0430\u044f \u0430\u0440\u043c\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85_II_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%9F%D1%80%D1%83%D1%81%D1%81%D0%B8%D0%B8)\" title=\"\u0424\u0440\u0438\u0434\u0440\u0438\u0445 II (\u043a\u043e\u0440\u043e\u043b\u044c \u041f\u0440\u0443\u0441\u0441\u0438\u0438)\">\u0424\u0440\u0438\u0434\u0440\u0438\u0445\u0430 II<\/a> \u0432\u0441\u0442\u0440\u0435\u0442\u0438\u043b\u0430\u0441\u044c \u0441 40-\u0442\u044b\u0441\u044f\u0447\u043d\u043e\u0439 \u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0435\u0439. \u041f\u0435\u0440\u0435\u0434 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435\u043c \u0433\u0435\u043d\u0435\u0440\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B5%D1%80%D0%BC%D0%BE%D1%80,_%D0%92%D0%B8%D0%BB%D0%BB%D0%B8%D0%BC_%D0%92%D0%B8%D0%BB%D0%BB%D0%B8%D0%BC%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0424\u0435\u0440\u043c\u043e\u0440, \u0412\u0438\u043b\u043b\u0438\u043c \u0412\u0438\u043b\u043b\u0438\u043c\u043e\u0432\u0438\u0447\">\u0412.&#160;\u0412.&#160;\u0424\u0435\u0440\u043c\u043e\u0440<\/a> \u0441\u043a\u0440\u044b\u043b\u0441\u044f \u0432 \u043b\u0435\u0441\u0430\u0445, \u043e\u0441\u0442\u0430\u0432\u0438\u0432 \u0440\u0443\u0441\u0441\u043a\u0443\u044e \u0430\u0440\u043c\u0438\u044e \u0431\u0435\u0437 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u044f. \u041f\u043e\u0441\u043b\u0435 \u043d\u0430\u043f\u0440\u044f\u0436\u0451\u043d\u043d\u043e\u0439 \u0431\u0438\u0442\u0432\u044b, \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u0432\u0448\u0435\u0439\u0441\u044f \u0432\u0435\u0441\u044c \u0434\u0435\u043d\u044c, \u0440\u0443\u0441\u0441\u043a\u0430\u044f \u0430\u0440\u043c\u0438\u044f \u043e\u0441\u0442\u0430\u043b\u0430\u0441\u044c \u043d\u0430 \u043f\u043e\u043b\u0435 \u0431\u043e\u044f, \u043d\u043e \u0432\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u0432\u044b\u043d\u0443\u0436\u0434\u0435\u043d\u043d\u0443\u044e \u043f\u043e\u0441\u043b\u0435 \u044d\u0442\u043e\u0433\u043e \u0441\u043d\u044f\u0442\u044c \u043e\u0441\u0430\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%81%D1%82%D1%88%D0%B8%D0%BD-%D0%BD%D0%B0%D0%B4-%D0%9E%D0%B4%D1%80%D0%BE%D0%B9\" class=\"mw-redirect\" title=\"\u041a\u043e\u0441\u0442\u0448\u0438\u043d-\u043d\u0430\u0434-\u041e\u0434\u0440\u043e\u0439\">\u041a\u044e\u0441\u0442\u0440\u0438\u043d\u0430<\/a>. \u041f\u0440\u0443\u0441\u0441\u043a\u0430\u044f \u0430\u0440\u043c\u0438\u044f \u043f\u043e\u043d\u0435\u0441\u043b\u0430 \u043e\u0433\u0440\u043e\u043c\u043d\u044b\u0435 \u043f\u043e\u0442\u0435\u0440\u0438, \u043e\u0441\u043e\u0431\u0435\u043d\u043d\u043e \u0441\u0440\u0435\u0434\u0438 \u0433\u0432\u0430\u0440\u0434\u0435\u0439\u0441\u043a\u0438\u0445 \u0447\u0430\u0441\u0442\u0435\u0439. \u041f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u044f \u0426\u043e\u0440\u043d\u0434\u043e\u0444\u0441\u043a\u043e\u0433\u043e \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u044f \u0441\u043a\u0430\u0437\u0430\u043b\u0438\u0441\u044c \u043d\u0430 \u0432\u043e\u0435\u043d\u043d\u043e\u0439 \u043a\u0430\u043c\u043f\u0430\u043d\u0438\u0438 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0435\u0433\u043e, 1759 \u0433\u043e\u0434\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1784_%D0%B3%D0%BE%D0%B4\" title=\"1784 \u0433\u043e\u0434\">1784<\/a>&#160;\u2014 \u041f\u043e\u043b\u0451\u0442 \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u0448\u043e\u0442\u043b\u0430\u043d\u0434\u0441\u043a\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%8D%D1%80%D0%BE%D0%BD%D0%B0%D0%B2%D1%82\" class=\"mw-redirect\" title=\"\u0410\u044d\u0440\u043e\u043d\u0430\u0432\u0442\">\u0430\u044d\u0440\u043e\u043d\u0430\u0432\u0442\u0430<\/a> \u0414\u0436\u0435\u0439\u043c\u0441\u0430 \u0422\u0438\u0442\u043b\u0435\u0440\u0430 (James Titler) \u043d\u0430 \u0441\u0430\u043c\u043e\u0434\u0435\u043b\u044c\u043d\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D0%B3%D0%BE%D0%BB%D1%8C%D1%84%D1%8C%D0%B5%D1%80\" title=\"\u041c\u043e\u043d\u0433\u043e\u043b\u044c\u0444\u044c\u0435\u0440\">\u043c\u043e\u043d\u0433\u043e\u043b\u044c\u0444\u044c\u0435\u0440\u0435<\/a>. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%8D%D1%80%D0%BE%D1%81%D1%82%D0%B0%D1%82\" title=\"\u0410\u044d\u0440\u043e\u0441\u0442\u0430\u0442\">\u0410\u044d\u0440\u043e\u0441\u0442\u0430\u0442<\/a> \u0441\u0442\u0430\u0440\u0442\u043e\u0432\u0430\u043b \u0438\u0437 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0433\u043e \u0441\u0430\u0434\u0430 \u0425\u0435\u0440\u0438\u043e\u0442 \u0438 \u043f\u043e\u0434\u043d\u044f\u043b\u0441\u044f \u043d\u0430 \u0432\u044b\u0441\u043e\u0442\u0443 \u043e\u043a\u043e\u043b\u043e 150 \u043c\u0435\u0442\u0440\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1793_%D0%B3%D0%BE%D0%B4\" title=\"1793 \u0433\u043e\u0434\">1793<\/a>&#160;\u2014 \u0420\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u043d\u044b\u0435 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u0432\u0437\u044f\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D1%81%D0%B5%D0%BB%D1%8C\" title=\"\u041c\u0430\u0440\u0441\u0435\u043b\u044c\">\u041c\u0430\u0440\u0441\u0435\u043b\u044c<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1805_%D0%B3%D0%BE%D0%B4\" title=\"1805 \u0433\u043e\u0434\">1805<\/a><ul><li>\u0420\u0443\u0441\u0441\u043a\u0430\u044f \u0430\u0440\u043c\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D1%82%D1%83%D0%B7%D0%BE%D0%B2,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%98%D0%BB%D0%BB%D0%B0%D1%80%D0%B8%D0%BE%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" class=\"mw-redirect\" title=\"\u041a\u0443\u0442\u0443\u0437\u043e\u0432, \u041c\u0438\u0445\u0430\u0438\u043b \u0418\u043b\u043b\u0430\u0440\u0438\u043e\u043d\u043e\u0432\u0438\u0447\">\u041c. \u041a\u0443\u0442\u0443\u0437\u043e\u0432\u0430<\/a> \u0432\u044b\u0441\u0442\u0443\u043f\u0438\u043b\u0430 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A0%D0%B0%D0%B4%D0%B7%D0%B8%D0%B2%D0%B8%D0%BB%D0%BB%D0%BE%D0%B2&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0420\u0430\u0434\u0437\u0438\u0432\u0438\u043b\u043b\u043e\u0432 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0420\u0430\u0434\u0437\u0438\u0432\u0438\u043b\u043b\u043e\u0432\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0438\u044e<\/a> \u0434\u043b\u044f \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u044b\u0445 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0439 \u043f\u0440\u043e\u0442\u0438\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u0430<\/a>.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%91%D0%BE%D0%B3%D0%B5%D0%BD%D1%85%D0%B0%D1%83%D0%B7%D0%B5%D0%BD&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0411\u043e\u0433\u0435\u043d\u0445\u0430\u0443\u0437\u0435\u043d (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0411\u043e\u0433\u0435\u043d\u0445\u0430\u0443\u0437\u0435\u043d\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d<\/a> \u0437\u0430\u043a\u043b\u044e\u0447\u0438\u043b \u0441\u043e\u044e\u0437 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B2%D0%B0%D1%80%D0%B8%D1%8F\" title=\"\u0411\u0430\u0432\u0430\u0440\u0438\u044f\">\u0411\u0430\u0432\u0430\u0440\u0438\u0435\u0439<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1819_%D0%B3%D0%BE%D0%B4\" title=\"1819 \u0433\u043e\u0434\">1819<\/a>&#160;\u2014 \u0412 \u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0441\u043a\u0438\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8C%D0%BF%D1%8B\" title=\"\u0410\u043b\u044c\u043f\u044b\">\u0410\u043b\u044c\u043f\u0430\u0445<\/a> \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d \u0438\u0441\u0442\u043e\u0447\u043d\u0438\u043a, \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 \u0434\u0430\u043b\u0438 \u0438\u043c\u044f \u0421\u0430\u0441\u043a\u0438\u044f \u0438 \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u043e\u043d\u043d\u044b\u0439 \u043d\u043e\u043c\u0435\u0440 64. \u0414\u043e \u0441\u0438\u0445 \u043f\u043e\u0440 \u0432\u043e\u0434\u0430 \u0438\u0437 \u044d\u0442\u043e\u0433\u043e \u0438\u0441\u0442\u043e\u0447\u043d\u0438\u043a\u0430 \u0441\u0447\u0438\u0442\u0430\u0435\u0442\u0441\u044f \u0441\u0430\u043c\u043e\u0439 \u0447\u0438\u0441\u0442\u043e\u0439, \u0446\u0435\u043b\u0435\u0431\u043d\u043e\u0439 \u0438 \u043d\u0430\u0441\u044b\u0449\u0435\u043d\u043d\u043e\u0439 \u043c\u0438\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u043c\u0438 \u0441\u043e\u043b\u044f\u043c\u0438 \u0432 \u0441\u0430\u043c\u043e\u0439 \u0447\u0442\u043e \u043d\u0438 \u043d\u0430 \u0435\u0441\u0442\u044c \u0432\u0435\u0440\u043d\u043e\u0439 \u043f\u0440\u043e\u043f\u043e\u0440\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1825_%D0%B3%D0%BE%D0%B4\" title=\"1825 \u0433\u043e\u0434\">1825<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D1%80%D1%83%D0%B3%D0%B2%D0%B0%D0%B9\" title=\"\u0423\u0440\u0443\u0433\u0432\u0430\u0439\">\u0423\u0440\u0443\u0433\u0432\u0430\u0439<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b \u0441\u0432\u043e\u044e \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D0%B7%D0%B8%D0%BB%D0%B8%D1%8F\" title=\"\u0411\u0440\u0430\u0437\u0438\u043b\u04