b-\u043c\u0430\u0439\u043e\u0440\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1967_%D0%B3%D0%BE%D0%B4\" title=\"1967 \u0433\u043e\u0434\">1967<\/a>&#160;\u2014 \u041c\u0435\u0436\u0434\u0443 \u041a\u0440\u0435\u043c\u043b\u0435\u043c \u0438 \u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0446\u0438\u0435\u0439 \u043f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0430 \u043b\u0438\u043d\u0438\u044f \u043f\u0440\u044f\u043c\u043e\u0439 \u0441\u0432\u044f\u0437\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1968_%D0%B3%D0%BE%D0%B4\" title=\"1968 \u0433\u043e\u0434\">1968<\/a>&#160;\u2014 \u0412\u043e\u0441\u0435\u043c\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D1%81%D1%81%D0%B8%D0%B4%D0%B5%D0%BD%D1%82%D1%8B_%D0%B2_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u0414\u0438\u0441\u0441\u0438\u0434\u0435\u043d\u0442\u044b \u0432 \u0421\u0421\u0421\u0420\">\u0434\u0438\u0441\u0441\u0438\u0434\u0435\u043d\u0442\u043e\u0432<\/a> \u043f\u0440\u043e\u0432\u0435\u043b\u0438 \u043d\u0430 \u041a\u0440\u0430\u0441\u043d\u043e\u0439 \u043f\u043b\u043e\u0449\u0430\u0434\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BC%D0%BE%D0%BD%D1%81%D1%82%D1%80%D0%B0%D1%86%D0%B8%D1%8F_25_%D0%B0%D0%B2%D0%B3%D1%83%D1%81%D1%82%D0%B0_1968_%D0%B3%D0%BE%D0%B4%D0%B0\" title=\"\u0414\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u044f 25 \u0430\u0432\u0433\u0443\u0441\u0442\u0430 1968 \u0433\u043e\u0434\u0430\">\u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u044e \u043f\u0440\u043e\u0442\u0438\u0432 \u0432\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a<\/a> \u0432 \u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u043a\u0438\u044e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1969_%D0%B3%D0%BE%D0%B4\" title=\"1969 \u0433\u043e\u0434\">1969<\/a>&#160;\u2014 \u041d\u0430 \u0441\u043e\u0432\u0435\u0449\u0430\u043d\u0438\u0438 \u041b\u0438\u0433\u0438 \u0430\u0440\u0430\u0431\u0441\u043a\u0438\u0445 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B8%D1%80\" title=\"\u041a\u0430\u0438\u0440\">\u041a\u0430\u0438\u0440\u0435<\/a> \u043f\u0440\u0438\u043d\u044f\u0442 \u043f\u043b\u0430\u043d \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u0439 \u0432\u043e\u0439\u043d\u044b \u0430\u0440\u0430\u0431\u043e\u0432 \u043f\u0440\u043e\u0442\u0438\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B7%D1%80%D0%B0%D0%B8%D0%BB%D1%8C\" title=\"\u0418\u0437\u0440\u0430\u0438\u043b\u044c\">\u0418\u0437\u0440\u0430\u0438\u043b\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1972_%D0%B3%D0%BE%D0%B4\" title=\"1972 \u0433\u043e\u0434\">1972<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9\" class=\"mw-redirect\" title=\"\u041a\u0438\u0442\u0430\u0439\">\u041a\u0438\u0442\u0430\u0439<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432\u043e\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043b\u0441\u044f \u043f\u0440\u0430\u0432\u043e\u043c \u0432\u0435\u0442\u043e \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B3%D0%B0%D0%BD%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F_%D0%9E%D0%B1%D1%8A%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D0%9D%D0%B0%D1%86%D0%B8%D0%B9\" title=\"\u041e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u041d\u0430\u0446\u0438\u0439\">\u041e\u041e\u041d<\/a>, \u043f\u0440\u043e\u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u0432 \u043f\u0440\u04